import React from "react";
import '../hoja-de-estilos/Navegacion.css';


/* Todo componente debe iniciar con mayusculas*/
function Navegacion(){
    return(
        <div className="contenedor-principal">
            <div className="contenedor-texto">
                <nav className="navegacion">
                    <a className="enlaces-texto" href="inicio">Inicio</a>
                    <a className="enlaces-texto" href="sobre-productos">Productos</a>
                    <a className="enlaces-texto" href="sobre-testimonios">Testimonios</a>
                    <a className="enlaces-texto" href="https://www.google.com/" target="_blank" rel="noopener">Buscador</a>
                </nav>
            </div>
        </div>
    );};

export default Navegacion;
